import React from "react";
import { sphere } from "./primitives";

export default function PrimitiveNode({ data }) {
  return (
    <div className="custom-node">
      <div className="custom-node-header">Ejemplo:</div>
      <Shader
        shader={fs(sphere(1))}
        uniforms={{ color: { type: "3fv", value: color } }}
        style={{ margin: "10px" }}
      />
    </div>
  );
}
